import React from 'react'
import logo from './logo.svg'
import './App.css'
import styled from 'styled-components'

const ListContainer = styled.div`
  width: 650px;
  height: 800px;
  background: #e1e6eb;
`
const Header = styled.h1`
  font-size: 1.5em;
  color: #354352;
  padding-top: 50px;
`
const SearchBar = styled.div`
  width: 500px;
  height: 50px;
  background: white;
`
const ListResults = styled.div`
  width 500px;
  min-height: 50px;
  background: white;
`
const SearchContainer = styled.div``

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ListContainer>
          <Header>REACT TO-DO</Header>
          <SearchContainer>
          <SearchBar /> <br />
          <ListResults />

          </SearchContainer>
        </ListContainer>
      </header>
    </div>
  )
}

export default App
